import React from 'react'
import {Link} from 'react-router-dom'

function BlogTop(props) {
    const css = {
        body : {
            width: '100%',
            height: '50px',

            backgroundColor: '#0d1a2c',

            display: 'flex',
            justifyContent: 'space-between',

        },
        link : {
            textDecoration: 'none',
            color: 'white'
        }



    }







    return (
        <div style={css.body}>
            <Link to='/blog' style={css.link}>
                <div>‚ÜêBlog</div>
            </Link>



        </div>
    )
}

export default BlogTop;
